import React from 'react';
import Card from './card';
import {faCheckCircle} from '@fortawesome/free-solid-svg-icons';

const Invoice = () => {
    const infoData = [
        { text: "Customizable templates", icon: faCheckCircle },
        { text: "GST reports", icon: faCheckCircle },
        { text: "Premium support", icon: faCheckCircle },
      ];

  return (
   <Card 
    header={"Creating invoices lightning fast."}
    subHeader={"Get a detailed summary of all your sales transactions."} 
    buttonText= {"Create your 1st invoice"}
    infoData={infoData}
    />
  )
}

export default Invoice
